const axios = require('axios')

export default async function addToTeam(player, currentPlayers, maxAmount, team) {
    const { data } = await axios.post('http://localhost:5000/addPlayer', {
        player,
        currentPlayers,
        maxAmount,
        team
    })
    return data
}
